## Purpose of the pull request

<!--(For example: This pull request adds checkstyle plugin).-->
This pull request fixed issue [#14114](https://github.com/apache/dolphinscheduler/issues/14114)

## Brief change log

Added an annotation to `org.apache.dolphinscheduler.plugin.task.seatunnel.SeatunnelParameters.class`. 

class annotation before: 
`@JsonSubTypes({
        @JsonSubTypes.Type(value = SeatunnelFlinkParameters.class, name = "FLINK"),
        @JsonSubTypes.Type(value = SeatunnelSparkParameters.class, name = "SPARK")
})`
class annotation after: 
`@JsonSubTypes({
        @JsonSubTypes.Type(value = SeatunnelFlinkParameters.class, name = "FLINK"),
        @JsonSubTypes.Type(value = SeatunnelSparkParameters.class, name = "SPARK"),
        @JsonSubTypes.Type(value = SeatunnelEngineParameters.class, name = "SEATUNNEL_ENGINE")
})`

## Verify this pull request
After the annotation change, I repackaged the source code and test the seatunnel engine parameter, it works well.
